@Component({
  selector: 'app-route',
  templateUrl: './route.component.html',
  styleUrls: ['./route.component.css']
})
export class RouteComponent implements OnInit {

  private readonly AUTH_KEY = 'authenticated';

  constructor(){

  }
  ngOnInit(){
    this.getData();
  }

  getData(){
    console.log(localStorage.getItem(this.AUTH_KEY))
  }
}
